description":"Specializations and courses in the arts and humanities (including fine arts, history, and philosophy) explore the historical context of creative works and teach you to review source material critically, draw connections between diverse ideas, and evaluate evidence and arguments. Coursework in this field will help you become a better reader, thinker, artist, and writer.","id":"arts-and-humanities"},{"subdomainIds":["leadership-and-management","finance","marketing","entrepreneurship","business-essentials","business-strategy"],"keywords":["small business","international business","business administration","business management","opportunities","sell","finance","economic","global","ethics","investment"],"name":"Business","description":"Business Specializations and courses help you hone skills critical to success in the modern workplace, with areas of study including entrepreneurship, business strategy, marketing, finance, and management. Whether you're a small business owner or working in a large international firm, business courses will improve your ability to analyze, understand, and solve business problems.","id":"business"},{"subdomainIds":["software-development","mobile-and-web-development","algorithms","computer-security-and-networks","design-and-product"],"keywords":["program","engineering","introduction","theoretical","mathematics","projects","computational science","technology","networking","graphics","applications","algorithms","programming"],"name":"Computer Science","description":"Computer science Specializations and courses teach software engineering and design, algorithmic thinking, human-computer interaction, programming languages, and the history of computing. Courses in this broad field will help you think abstractly, approach problems methodically, and develop sound solutions.","id":"computer-science"},{"subdomainIds":["data-analysis","machine-learning","probability-and-statistics"],"keywords":["qualitative data analysis","exploratory data analysis","tools","methods","techniques","software","research","analyst","interpretation"],"name":"Data Science","description":"Data science Specializations and courses teach the fundamentals of interpreting data, performing analyses, and understanding and communicating actionable insights. Topics of study for beginning and advanced learners include qualitative and quantitative data analysis, tools and methods for data manipulation, and machine learning algorithms.","id":"data-science"},{"subdomainIds":["cloud-computing","security","data-management","networking","support-and-operations"],"keywords":["networking","cloud computing","security","data management","operations"],"name":"Information Technology","description":"Information Technology (IT) courses and specializations teach cloud computing, cyber security, data management, networking, and more. Learn to use computers to meet day-to-day business needs and launch or advance your career in the IT industry.","id":"information-technology"},{"subdomainIds":["animal-health","basic-science","health-informatics","healthcare-management","nutrition","patient-care","public-health","research","psychology"],"keywords":["science","cellular","molecular","agriculture","companies","branches","impact factor","bio","biotechnology","zoology","biology","neuroscience","horticulture","biochemistry","plant"],"name":"Health","description":"Health Specializations and courses explore topics related to science, your health, and the health and well being of others. Whether you're interested in science, a trained healthcare professional, or looking to transition into this rapidly growing industry, health courses will improve your ability to understand animal and plant life, use big data to solve key health challenges, manage teams, and conduct evidence-based research.","id":"life-sciences","slug":"health"},{"subdomainIds":["math-and-logic"],"keywords":["problems","logical","mathematical","philosophy","calculator","puzzles","logically","thin  of machine learning and how to use these techniques to build real-world AI applications. \n\nThis Specialization is taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\n\nThis 3-course Specialization is an updated and expanded version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012. \n\nIt provides a broad introduction to modern machine learning, including supervised learning (multiple linear regression, logistic regression, neural networks, and decision trees), unsupervised learning (clustering, dimensionality reduction, recommender systems), and some of the best practices used in Silicon Valley for artificial intelligence and machine learning innovation (evaluating and tuning models, taking a data-centric approach to improving performance, and more.)\n\nBy the end of this Specialization, you will have mastered key concepts and gained the practical know-how to quickly and powerfully apply machine learning to challenging real-world problems. If you’re looking to break into AI or build a career in machine learning, the new Machine Learning Specialization is the best place to start.","id":"T7hf5jWeEeuGCBL8_hyTUQ","photoUrl":"https:\u002F\u002Fd3njjcbhbojbot.cloudfront.net\u002Fapi\u002Futilities\u002Fv1\u002Fimageproxy\u002Fhttps:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002F9c\u002F90ae67ecdb4185a4ae79ec9a5ae0b6\u002FCourse-Logo--1.png","slug":"machine-learning","courseType":"v2.ondemand","name":"Supervised Machine Learning: Regression and Classification ","s12nIds":["nOOfCDWeEeuiZgo2K4rorQ"],"courseStatus":"launched","partnerIds":["475","1"],"premiumExperienceVariant":"PremiumGrading"}},"productOwnerships.v1":{"101174321~VerifiedCertificate~T7hf5jWeEeuGCBL8_hyTUQ":{"owns":true,"s12nCourseOwnerships":null,"lastUpdated":1692332969413,"pendingConfirma You learned some of the best practices for building machine learning models. You’ve also gained practical skills to apply machine learning techniques to challenging real-world problems.\n\nNow #BreakIntoAI and start building your career in machine learning!","recommendedBackground":[],"companyLogos":[],"level":"BEGINNER","partnerImages":{"1":"","475":"https:\u002F\u002Fd15cw65ipctsrr.cloudfront.net\u002F9f\u002Fcef10dfcfc47bdada663234eaef3c8\u002Foffice-image-01.png"},"learningObjectives":[],"coBrandingEnabled":true,"certificateLogo":"https:\u002F\u002Fd15cw65ipctsrr.cloudfront.net\u002F3a\u002F9d2a7af297483a845340bcfbac6f1e\u002FMLS.course-banners-01_Course-Logo-.png","cmlAdditionalFaqs":[{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat is machine learning?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat is machine learning?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EMachine learning is a branch of artificial intelligence that enables algorithms to automatically learn from data without being explicitly programmed. Its practitioners train algorithms to identify patterns in data and to make decisions with minimal human intervention.\u003C\u002Ftext\u003E\u003Ctext\u003EIn the past two decades, machine learning has gone from a niche academic interest to a&#xa0; central part of the tech industry. It has given us self-driving cars, speech and image recognition, effective web search, fraud detection, a vastly improved understanding of the human genome, and many other advances. Amid this explosion of applications, there is a shortage of qualified data scientists, analysts, and machine learning engineers, making them some of the world’s most in-demand professionals.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EMachine learning is a branch of artificial intelligence that enables algorithms to automatically learn from data without being explicitly programmed. Its practitioners train algorithms to identify patterns in data and to make decisions with minimal human intervention.\u003C\u002Fp\u003E\u003Cp\u003EIn the past two decades, machine learning has gone from a niche academic interest to a&nbsp; central part of the tech industry. It has given us self-driving cars, speech and image recognition, effective web search, fraud detection, a vastly improved understanding of the human genome, and many other advances. Amid this explosion of applications, there is a shortage of qualified data scientists, analysts, and machine learning engineers, making them some of the world’s most in-demand professionals.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat is the Machine Learning Specialization about?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat is the Machine Learning Specialization about?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Machine Learning Specialization is a foundational online program created in collaboration between DeepLearning.AI and Stanford Online. This beginner-friendly program will teach you the fundamentals of machine learning and how to use these techniques to build real-world AI applications.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EThis Specialization is taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\u003C\u002Ftext\u003E\u003Ctext\u003EThis 3-course Specialization is an updated version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EIt provides a broad introduction to modern machine learning, including supervised learning (multiple linear regression, logistic regression, neural networks, and decision trees), unsupervised learning (clustering, dimensionality reduction, recommender systems), and some of the best practices used in Silicon Valley for artificial intelligence and machine learning innovation (evaluating and tuning models, taking a data-centric approach to improving performance, and more.)\u003C\u002Ftext\u003E\u003Ctext\u003EBy the end of this Specialization, you will have mastered key concepts and gained the practical know-how to quickly and powerfully apply machine learning to challenging real-world problems. If you’re looking to break into AI or build a career in machine learning, the new Machine Learning Specialization is the best place to start.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Machine Learning Specialization is a foundational online program created in collaboration between DeepLearning.AI and Stanford Online. This beginner-friendly program will teach you the fundamentals of machine learning and how to use these techniques to build real-world AI applications.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EThis Specialization is taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\u003C\u002Fp\u003E\u003Cp\u003EThis 3-course Specialization is an updated version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EIt provides a broad introduction to modern machine learning, including supervised learning (multiple linear regression, logistic regression, neural networks, and decision trees), unsupervised learning (clustering, dimensionality reduction, recommender systems), and some of the best practices used in Silicon Valley for artificial intelligence and machine learning innovation (evaluating and tuning models, taking a data-centric approach to improving performance, and more.)\u003C\u002Fp\u003E\u003Cp\u003EBy the end of this Specialization, you will have mastered key concepts and gained the practical know-how to quickly and powerfully apply machine learning to challenging real-world problems. If you’re looking to break into AI or build a career in machine learning, the new Machine Learning Specialization is the best place to start.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat will I learn in the Machine Learning Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat will I learn in the Machine Learning Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EBy the end of this Specialization, you will be ready to\u003C\u002Ftext\u003E\u003Ctext\u003E&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003E• Build ML models with NumPy &amp; scikit-learn, build &amp; train supervised models for prediction &amp; binary classification tasks (linear, logistic regression)\u003C\u002Ftext\u003E\u003Ctext\u003E• Build and train a neural network with TensorFlow to perform multi-class classification.\u003C\u002Ftext\u003E\u003Ctext\u003E• Apply best practices for machine learning development so that your models generalize to data and tasks in the real world.\u003C\u002Ftext\u003E\u003Ctext\u003E• Build and use decision trees and tree ensemble methods, including random forests and boosted trees.\u003C\u002Ftext\u003E\u003Ctext\u003E• Use unsupervised learning techniques for unsupervised learning including clustering and anomaly detection.\u003C\u002Ftext\u003E\u003Ctext\u003E• Build recommender systems with a collaborative filtering approach and a content-based deep learning method.\u003C\u002Ftext\u003E\u003Ctext\u003E• Build a deep reinforcement learning model.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EBy the end of this Specialization, you will be ready to\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E• Build ML models with NumPy &amp; scikit-learn, build &amp; train supervised models for prediction &amp; binary classification tasks (linear, logistic regression)\u003C\u002Fp\u003E\u003Cp\u003E• Build and train a neural network with TensorFlow to perform multi-class classification.\u003C\u002Fp\u003E\u003Cp\u003E• Apply best practices for machine learning development so that your models generalize to data and tasks in the real world.\u003C\u002Fp\u003E\u003Cp\u003E• Build and use decision trees and tree ensemble methods, including random forests and boosted trees.\u003C\u002Fp\u003E\u003Cp\u003E• Use unsupervised learning techniques for unsupervised learning including clustering and anomaly detection.\u003C\u002Fp\u003E\u003Cp\u003E• Build recommender systems with a collaborative filtering approach and a content-based deep learning method.\u003C\u002Fp\u003E\u003Cp\u003E• Build a deep reinforcement learning model.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat background knowledge is necessary for the Machine Learning Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat background knowledge is necessary for the Machine Learning Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ELearners should understand basic coding (for loops, functions, if\u002Felse statements) and high school-level math (arithmetic, algebra). Any additional math concepts will be explained along the way.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ELearners should understand basic coding (for loops, functions, if\u002Felse statements) and high school-level math (arithmetic, algebra). Any additional math concepts will be explained along the way.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWho is the Machine Learning Specialization for?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWho is the Machine Learning Specialization for?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Machine Learning Specialization is a beginner-level program aimed at those new to AI and looking to gain a foundational understanding of machine learning models and real-world experience building systems using Python.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EThis Specialization is suitable for learners with some basic knowledge of programming and high-school level math, as well as early-stage professionals in software engineering and data analysis who wish to upskill in machine learning. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Machine Learning Specialization is a beginner-level program aimed at those new to AI and looking to gain a foundational understanding of machine learning models and real-world experience building systems using Python.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EThis Specialization is suitable for learners with some basic knowledge of programming and high-school level math, as well as early-stage professionals in software engineering and data analysis who wish to upskill in machine learning. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow long does it take to complete the Machine Learning Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow long does it take to complete the Machine Learning Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThis Specialization consists of three courses. At the rate of 5 hours per week, it will take 3 weeks to complete Course 1, 4 weeks to complete Course 2, and 3 weeks to complete Course 3 of the Machine Learning Specialization.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThis Specialization consists of three courses. At the rate of 5 hours per week, it will take 3 weeks to complete Course 1, 4 weeks to complete Course 2, and 3 weeks to complete Course 3 of the Machine Learning Specialization.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWho created the Machine Learning Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWho created the Machine Learning Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThis Specialization was created by Andrew Ng, Eddy Shyu, Aarti Bagul, and Geoff Ladwig.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003E\u003Ca href=\"http:\u002F\u002Flinkedin.com\u002Fin\u002Fandrewyng\" title=\"\"\u003EAndrew Ng\u003C\u002Fa\u003E is the Founder of DeepLearning.AI, Founder and CEO of Landing AI, Chairman and Co-founder of Coursera, and an Adjunct Professor at Stanford University. Dr. Ng has changed countless lives through his work, authoring or co-authoring over 200 research papers in machine learning, robotics, and related fields. He was the founding lead of the Google Brain team and Chief Scientist at Baidu, and through this work built the teams that led the AI transformation of two leading internet companies. He is the co-founder and Chairman of Coursera — the world's largest online learning platform — which had started with his machine learning course. Dr. Ng now focuses primarily on his entrepreneurial ventures, looking for the best ways to accelerate responsible AI practices in the larger global economy.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Feddy-shyu\u002F\" title=\"\"\u003EEddy Shyu\u003C\u002Fa\u003E is a product lead at DeepLearning.AI and has led the teams that built the Machine Learning Specialization (featuring Andrew Ng), TensorFlow Advanced Techniques (featuring Laurence Moroney), as well as the Natural Language Processing Specialization, and AI for Medicine Specialization. Eddy was also co-instructor for Udacity's AI for Trading Nanodegree program.\u003C\u002Ftext\u003E\u003Ctext\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Faartibagul\" title=\"\"\u003EAarti Bagul\u003C\u002Fa\u003E is a machine learning engineer at Snorkel AI. Before Snorkel, she worked closely with Andrew Ng in various capacities: At the AI Fund, she helped build and invest in machine learning companies. Previously, she was a machine learning engineer at Landing AI and was the head teacher’s assistant for Dr. Ng’s deep learning class at Stanford University. She graduated with a Master's in Computer Science from Stanford and a Bachelor's in Computer Science and Computer Engineering from NYU with the highest honors.\u003C\u002Ftext\u003E\u003Ctext\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Fgeoff-ladwig-2650241\u002F\" title=\"\"\u003EGeoff Ladwig\u003C\u002Fa\u003E started as a Deep Learning student and a mentor for the Deep Learning Specialization. He worked as a consultant on the Natural Language Processing Specialization and as a Curriculum Engineer on the Machine Learning Specialization. Geoff has spent most of his career as an ASIC\u002FHardware\u002FSystem engineer\u002Farchitect in the communications and computer industries.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThis Specialization was created by Andrew Ng, Eddy Shyu, Aarti Bagul, and Geoff Ladwig.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"http:\u002F\u002Flinkedin.com\u002Fin\u002Fandrewyng\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EAndrew Ng\u003C\u002Fa\u003E is the Founder of DeepLearning.AI, Founder and CEO of Landing AI, Chairman and Co-founder of Coursera, and an Adjunct Professor at Stanford University. Dr. Ng has changed countless lives through his work, authoring or co-authoring over 200 research papers in machine learning, robotics, and related fields. He was the founding lead of the Google Brain team and Chief Scientist at Baidu, and through this work built the teams that led the AI transformation of two leading internet companies. He is the co-founder and Chairman of Coursera — the world's largest online learning platform — which had started with his machine learning course. Dr. Ng now focuses primarily on his entrepreneurial ventures, looking for the best ways to accelerate responsible AI practices in the larger global economy.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Feddy-shyu\u002F\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EEddy Shyu\u003C\u002Fa\u003E is a product lead at DeepLearning.AI and has led the teams that built the Machine Learning Specialization (featuring Andrew Ng), TensorFlow Advanced Techniques (featuring Laurence Moroney), as well as the Natural Language Processing Specialization, and AI for Medicine Specialization. Eddy was also co-instructor for Udacity's AI for Trading Nanodegree program.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Faartibagul\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EAarti Bagul\u003C\u002Fa\u003E is a machine learning engineer at Snorkel AI. Before Snorkel, she worked closely with Andrew Ng in various capacities: At the AI Fund, she helped build and invest in machine learning companies. Previously, she was a machine learning engineer at Landing AI and was the head teacher’s assistant for Dr. Ng’s deep learning class at Stanford University. She graduated with a Master's in Computer Science from Stanford and a Bachelor's in Computer Science and Computer Engineering from NYU with the highest honors.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fwww.linkedin.com\u002Fin\u002Fgeoff-ladwig-2650241\u002F\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EGeoff Ladwig\u003C\u002Fa\u003E started as a Deep Learning student and a mentor for the Deep Learning Specialization. He worked as a consultant on the Natural Language Processing Specialization and as a Curriculum Engineer on the Machine Learning Specialization. Geoff has spent most of his career as an ASIC\u002FHardware\u002FSystem engineer\u002Farchitect in the communications and computer industries.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat makes the Machine Learning Specialization so unique?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat makes the Machine Learning Specialization so unique?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Machine Learning Specialization is a foundational online program taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\u003C\u002Ftext\u003E\u003Ctext\u003EThis 3-course Specialization is an updated and expanded version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EThis program has been designed to teach you foundational machine learning concepts without prior math knowledge or a rigorous coding background. Unlike the original course, which required some knowledge of math, the new Specialization aptly balances intuition, code practice, and mathematical theory to create a simple and effective learning experience for first-time students.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EEach lesson begins with a visual representation of machine learning concepts and a high-level explanation of the intuition behind them. It then provides the code to help you implement these algorithms and additional videos explaining the underlying math if you wish to dive deeper. These lessons are optional and are not required to complete the Specialization or apply machine learning to real-world projects.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EIf you’re looking to break into AI or build a career in machine learning, the new Machine Learning Specialization is the best place to start.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Machine Learning Specialization is a foundational online program taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\u003C\u002Fp\u003E\u003Cp\u003EThis 3-course Specialization is an updated and expanded version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EThis program has been designed to teach you foundational machine learning concepts without prior math knowledge or a rigorous coding background. Unlike the original course, which required some knowledge of math, the new Specialization aptly balances intuition, code practice, and mathematical theory to create a simple and effective learning experience for first-time students.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EEach lesson begins with a visual representation of machine learning concepts and a high-level explanation of the intuition behind them. It then provides the code to help you implement these algorithms and additional videos explaining the underlying math if you wish to dive deeper. These lessons are optional and are not required to complete the Specialization or apply machine learning to real-world projects.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EIf you’re looking to break into AI or build a career in machine learning, the new Machine Learning Specialization is the best place to start.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow is the new Machine Learning Specialization different from the original course?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow is the new Machine Learning Specialization different from the original course?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe new Machine Learning Specialization includes an expanded list of topics that focus on the most crucial machine learning concepts (such as decision trees) and tools (such as TensorFlow).\u003C\u002Ftext\u003E\u003Ctext\u003EUnlike the original course, the new Specialization is designed to teach foundational ML concepts without prior math knowledge or a rigorous coding background. It aptly balances intuition, code practice, and mathematical theory to create a simple and effective learning experience for first-time students.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EEach lesson begins with a visual representation of machine learning concepts and a high-level explanation of the intuition behind them. It then provides the code to help you implement these algorithms and additional videos explaining the underlying math if you wish to dive deeper. These lessons are optional and are not required to complete the Specialization or apply machine learning to real-world projects.\u003C\u002Ftext\u003E\u003Ctext\u003EIn the decade since the first Machine Learning course debuted, Python has become the primary programming language for AI applications. The assignments and lectures in the new Specialization have been rebuilt to use Python rather than Octave, like in the original course.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EBefore the graded programming assignments, there are additional ungraded code notebooks with sample code and interactive graphs to help you visualize what an algorithm is doing and make it easier to complete programming exercises.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EThe section on practical advice on applying machine learning has been updated significantly based on emerging best practices from the last decade.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe new Machine Learning Specialization includes an expanded list of topics that focus on the most crucial machine learning concepts (such as decision trees) and tools (such as TensorFlow).\u003C\u002Fp\u003E\u003Cp\u003EUnlike the original course, the new Specialization is designed to teach foundational ML concepts without prior math knowledge or a rigorous coding background. It aptly balances intuition, code practice, and mathematical theory to create a simple and effective learning experience for first-time students.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EEach lesson begins with a visual representation of machine learning concepts and a high-level explanation of the intuition behind them. It then provides the code to help you implement these algorithms and additional videos explaining the underlying math if you wish to dive deeper. These lessons are optional and are not required to complete the Specialization or apply machine learning to real-world projects.\u003C\u002Fp\u003E\u003Cp\u003EIn the decade since the first Machine Learning course debuted, Python has become the primary programming language for AI applications. The assignments and lectures in the new Specialization have been rebuilt to use Python rather than Octave, like in the original course.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EBefore the graded programming assignments, there are additional ungraded code notebooks with sample code and interactive graphs to help you visualize what an algorithm is doing and make it easier to complete programming exercises.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EThe section on practical advice on applying machine learning has been updated significantly based on emerging best practices from the last decade.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EI'm a complete beginner. Can I take this Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EI'm a complete beginner. Can I take this Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe new Machine Learning Specialization is the best entry point for beginners looking to break into the AI field or kick start their machine learning careers. This updated Specialization takes the core curriculum — which has been vetted by millions of learners over the years — and makes it more approachable for beginners.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EUnli p\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWill I receive a certificate at the end of the Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWill I receive a certificate at the end of the Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EYou will receive a certificate at the end of each course if you pay for the courses and complete the programming assignments. There is a limit of 180 days of certificate eligibility, after which you must re-purchase the course to obtain a certificate. If you audit the course for free, you will not receive a certificate.\u003C\u002Ftext\u003E\u003Ctext\u003EIf you complete all 4 courses and are subscribed to the Specialization, you will also receive an additional certificate showing that you completed the entire Specialization.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EYou will receive a certificate at the end of each course if you pay for the courses and complete the programming assignments. There is a limit of 180 days of certificate eligibility, after which you must re-purchase the course to obtain a certificate. If you audit the course for free, you will not receive a certificate.\u003C\u002Fp\u003E\u003Cp\u003EIf you complete all 4 courses and are subscribed to the Specialization, you will also receive an additional certificate showing that you completed the entire Specialization.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}}],"cmlLearningObjectives":[{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EBuild ML models with NumPy &amp; scikit-learn, build &amp; train supervised models for prediction &amp; binary classification tasks (linear, logistic regression)\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EBuild ML models with NumPy &amp; scikit-learn, build &amp; train supervised models for prediction &amp; binary classification tasks (linear, logistic regression)\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EBuild &amp; train a neural network with TensorFlow to perform multi-class classification, &amp; build &amp; use decision trees &amp; tree ensemble methods\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EBuild &amp; train a neural network with TensorFlow to perform multi-class classification, &amp; build &amp; use decision trees &amp; tree ensemble methods\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EApply best practices for ML development &amp; use unsupervised learning techniques for unsupervised learning including clustering &amp; anomaly detection\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EApply best practices for ML development &amp; use unsupervised learning techniques for unsupervised learning including clustering &amp; anomaly detection\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EBuild recommender systems with a collaborative filtering approach &amp; a content-based deep learning method &amp; build a deep reinforcement learning model\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EBuild recommender systems with a collaborative filtering approach &amp; a content-based deep learning method &amp; build a deep reinforcement learning model\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}],"additionalFaqs":[],"useDefaultFaqs":true,"subheader":"Master fundamental AI concepts and develop practical machine learning skills in the beginner-friendly, 3-course program by AI visionary Andrew Ng","partnerMarketingBlurbs":{"1":"","475":"DeepLearning.AI and Stanford Online are proud to collaborate on the new and updated Machine Learning Specialization. Beginners can break into AI in just 10 weeks with this 3-course online program, which will help them understand foundational concepts, cutting-edge techniques, and real-world applications in machine learning."},"headerImage":"","cmlRecommendedBackground":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Clist bulletType=\"bullets\"\u003E\u003Cli\u003E\u003Ctext\u003EBasic coding (for loops, functions, if\u002Felse statements) &amp; high school-level math (arithmetic, algebra)\u003C\u002Ftext\u003E\u003C\u002Fli\u003E\u003Cli\u003E\u003Ctext\u003EOther math concepts will be explained\u003C\u002Ftext\u003E\u003C\u002Fli\u003E\u003C\u002Flist\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cul\u003E\u003Cli\u003E\u003Cp\u003EBasic coding (for loops, functions, if\u002Felse statements) &amp; high school-level math (arithmetic, algebra)\u003C\u002Fp\u003E\u003C\u002Fli\u003E\u003Cli\u003E\u003Cp\u003EOther math concepts will be explained\u003C\u002Fp\u003E\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003C\u002Fdiv\u003E"}}},"sponsors":[],"headline":"#BreakIntoAI with Machine Learning Specialization"},"courseIds":["T7hf5jWeEeuGCBL8_hyTUQ","Z5rfkzWeEeusTAqaKUMfXQ","hD8t4jWeEeu9vAr5jUgnDQ"],"description":"The Machine Learning Specialization is a foundational online program created in collaboration between DeepLearning.AI and Stanford Online. This beginner-friendly program will teach you the fundamentals of machine learning and how to use these techniques to build real-world AI applications.\n\nThis Specialization is taught by Andrew Ng, an AI visionary who has led critical research at Stanford University and groundbreaking work at Google Brain, Baidu, and Landing.AI to advance the AI field.\n\nThis 3-course Specialization is an updated version of Andrew’s pioneering Machine Learning course, rated 4.9 out of 5 and taken by over 4.8 million learners since it launched in 2012.\n\nIt provides a broad introduction to modern machine learning, including supervised learning (multiple linear regression, logistic regression, neural networks, and decision trees), unsupervised learning (clustering, dimensionality reduction, recommender systems), and some of the best practices used in Silicon Valley for artificial intelligence and machine learnin
